	function Update-ADGroups
	{
		$lstADGroups.Items.Clear()
		$UserObject = $null
		$MemberOf = $null
		$MemberOfObject = $null
		
		$UserObject = Get-ADUserObject -Search $txtUsername.Text -FilterType 'SamAccountName'
		
		if ($UserObject.MemberOf.Count -gt 0)
		{
			#$MemberOf = $UserObject.MemberOf | Sort-Object
			$MemberOfObject = ($UserObject.MemberOf | Sort-Object) | ForEach-Object { Get-ADGroupObject -Search $_ -FilterType 'DistinguishedName' }
			
			Update-ListBox $lstADGroups $MemberOfObject "Name" -Append
		}	
		
		if ([string]::IsNullOrEmpty($UserObject.DisplayName)) { $GRPtxtName.Text = 'N/A' } else { $GRPtxtName.Text = $UserObject.DisplayName }
		if ([string]::IsNullOrEmpty($UserObject.Department)) { $txtDepartment.Text = 'N/A' } else { $txtDepartment.Text = $UserObject.Department }
		if ([string]::IsNullOrEmpty($UserObject.Description)) { $txtFunction.Text = 'N/A' } else { $txtFunction.Text = $UserObject.Description }
		if ([string]::IsNullOrEmpty($UserObject.SamAccountName)) { $txtSamAccountName.Text = 'N/A' } else { $txtSamAccountName.Text = $UserObject.SamAccountName }
		if ([string]::IsNullOrEmpty($UserObject.UserPrincipalName)) { $txtUserPrincipalName.Text = 'N/A' } else { $txtUserPrincipalName.Text = $UserObject.UserPrincipalName }
		if ([string]::IsNullOrEmpty($UserObject.mail)) { $txtEmailAddress.Text = 'N/A' } else { $txtEmailAddress.Text = $UserObject.mail }
		$txtGroupMembers.Text = $UserObject.MemberOf.Count
		return $true
	}
	
	function Update-ADGroupMembership
	{
		$lstGroupMembership.Items.Clear()
		$lstGroupMemberOf.Items.Clear()
		
		$GroupObject = Get-ADGroupObject -Search $GRPtxtGroupname.Text -FilterType 'Name'
	
		if ([string]::IsNullOrEmpty($GroupObject.ManagedBy))
		{
			$ManagedByGroupObject = $null
		}
		else
		{
			$ManagedByGroupObject = Get-ADGroupObject -Search $GroupObject.ManagedBy -FilterType 'DistinguishedName'
		}
		
		$GroupMemberObject = Get-ADGroupMemberObject -Search $GRPtxtGroupname.Text
	
		$GroupMemberOfObject = $GroupObject.MemberOf
		$DirectMemberCount = ($GroupMemberObject | Where-Object { $_.ObjectClass -eq 'user' }).Count
		$NestedGroupCount = ($GroupMemberObject | Where-Object { $_.ObjectClass -eq 'group' }).Count
		$MemberOfCount = $GroupMemberOfObject.Count
		
		### Fill Members Listbox
		if ($GroupMemberObject.Count -gt 0) { Update-ListBox $lstGroupMembership $GroupMemberObject "Name" }
		
		### Get Member Of from group
		if (($GroupMemberOfObject).Count -gt 0)
		{
			$GroupMemberOf = @()
			foreach ($i in $GroupMemberOfObject)
			{
				$GroupMemberOf += Get-ADGroupObject -Search $i -FilterType 'DistinguishedName'
			}
			
			if ($GroupMemberOf.Count -gt 0)
			{
				Update-ListBox $lstGroupMemberOf $GroupMemberOf "Name"
			}
		}
		
		### Fill Group Details
		if ([string]::IsNullOrEmpty($GroupObject.DisplayName)) { $GRPtxtDisplayname.Text = 'N/A' } else { $GRPtxtDisplayname.Text = $GroupObject.DisplayName }
		if ([string]::IsNullOrEmpty($GroupObject.CN)) { $GRPtxtName.Text = 'N/A' } else { $GRPtxtName.Text = $GroupObject.CN }
		if ([string]::IsNullOrEmpty($GroupObject.GroupCategory)) { $GRPtxtGroupCategory.Text = 'N/A' } else { $GRPtxtGroupCategory.Text = $GroupObject.GroupCategory }
		if ([string]::IsNullOrEmpty($GroupObject.GroupScope)) { $GRPtxtGroupScope.Text = 'N/A' } else { $GRPtxtGroupScope.Text = $GroupObject.GroupScope }
		if ([string]::IsNullOrEmpty($GroupObject.Info)) { $GRPtxtGroupInfo.Text = 'N/A' } else { $GRPtxtGroupInfo.Text = $GroupObject.Info }
		if ([string]::IsNullOrEmpty($ManagedByGroupObject.CN)) { $GRPtxtManagedBy.Text = 'N/A' } else { $GRPtxtManagedBy.Text = $ManagedByGroupObject.CN }
		$GRPtxtDirectMemberCount.Text = $DirectMemberCount
		$GRPtxtNestedGroupsCount.Text = $NestedGroupCount
		$GRPtxtMemberOfCount.Text = $MemberOfCount
		
		return $true
	}
	
