	$btnSearch_Click = {
		#TODO: Place custom script here
		#$rtbOutput.Clear()
		
		$ADObject = $()
		
		if ([string]::IsNullOrEmpty($txtUsername.Text))
		{
			$txtUsername.Focus()
			Paint-FocusBorder $txtUsername
			
			$rtbOutput.SelectionFont = $FontBold
			$rtbOutput.SelectionColor = 'Orange'
			$rtbOutput.AppendText("$($LanguageStrings.VBWarning) ")
			$rtbOutput.SelectionFont = $FontRegular
			$rtbOutput.SelectionColor = 'Black'
			$rtbOutput.AppendText("$($LanguageStrings.VBNoUserName)`r`n")
			$Proceed = $false
		}
		elseif ($txtUsername.Text -imatch '([Zz])\d+' -or $txtUsername.Text -imatch '([Ss])\d+' -or $txtUsername.Text -imatch '[Tt][Ee][Ss][Tt][Zz]\d+' -or $txtUsername.Text -imatch '[Mm][Aa][Nn][Zz]\d+' -or $txtUsername.Text -imatch '[Ff][Uu][Nn][Cc]\d+' -or $txtUsername.Text -imatch '[Pp][Bb]\d+' -or $txtUsername.Text -imatch '[Vv][Zz]\d+' -or $txtUsername.Text -imatch '[Ss][Vv][Cc]\d+')
		{
			$script:searchstring = "$($txtUsername.Text)*"
			$SamAccountName = $true
			$Proceed = $true
		}
		elseif ($txtUsername.Text.Length -lt 4)
		{
			$rtbOutput.SelectionFont = $FontBold
			$rtbOutput.SelectionColor = 'Orange'
			$rtbOutput.AppendText("$($LanguageStrings.VBWarning) ")
			$rtbOutput.SelectionFont = $FontRegular
			$rtbOutput.SelectionColor = 'Black'
			$rtbOutput.AppendText("$($LanguageStrings.VBTooFewChar)`r`n")
			$SamAccountName = $false
			$Proceed = $false
		}
		<#else
		{
			$script:searchstring = "*$($txtUsername.Text)*"
			$SamAccountName = $false
			$Proceed = $true
		}#>	
		
		if ($Proceed)
		{
			$statusbar1.Text = $LanguageStrings.STSSearchingUsers
			if ($SamAccountName)
			{
				$ADObject = Get-ADUserObject -Search $searchstring -FilterType 'SamAccountName' | Sort-Object SamAccountName
				$filter = 'SamAccountName'
			}
			else
			{
				$ADObject = Get-ADUserObject -Search $searchstring -FilterType 'Name'
				$ADObject += Get-ADUserObject -Search $searchstring -FilterType 'Description'
				$ADObject = $ADObject | Sort-Object Name
				$filter = 'Other'
			}
	
			if ($ADObject.SamAccountName.Count -gt 1)
			{
				### Open SelectObject scherm om de daadwerkelijke gebruiker te selecteren
				if ((Show-SelectObject_psf -LanguageStrings $LanguageStrings -GroupsorUsers $ADObject -ObjectType 'User' -FilterType $filter) -eq 'OK')
				{
					$txtUsername.Text = $script:SelectObject_lstSelectObject.SamAccountName
					$result = 'OK'
				}
				else
				{
					$result = 'Cancel'
				}
			}
			elseif ($ADObject.SamAccountName.Count -eq 1)
			{
				$txtUsername.Text = $ADObject.SamAccountName
				$result = 'OK'
			}
			else
			{
				$result = 'NotOK'
			}
			
			if ($result -eq 'OK')
			{
				
				$statusbar1.Text = $LanguageStrings.STSRefreshingMembership
				
				if (Update-ADGroups)
				{
					$btnAdd.Enabled = $true
					$btnRemove.Enabled = $true
					$btnAgain.Enabled = $true
					$btnCopy.Enabled = $true
					$btnExport.Enabled = $true
					
					Paint-FocusBorder $txtUsername
				}
			}
			elseif ($result -eq 'NotOK')
			{
				$rtbOutput.SelectionFont = $FontBold
				$rtbOutput.SelectionColor = 'Orange'
				$rtbOutput.AppendText("$($LanguageStrings.VBWarning) ")
				$rtbOutput.SelectionFont = $FontRegular
				$rtbOutput.SelectionColor = 'Black'
				$rtbOutput.AppendText("$($LanguageStrings.VBNoUserFound) ")
				$rtbOutput.SelectionFont = $FontBold
				$rtbOutput.AppendText("$($searchstring)")
				
				$txtUsername.Focus()
				
				$btnAdd.Enabled = $false
				$btnRemove.Enabled = $false
				$btnAgain.Enabled = $false
				
				Paint-FocusBorder $txtUsername
