	$GRPbtnSearch_Click = {
		#TODO: Place custom script here
		if ([string]::IsNullOrEmpty($GRPtxtGroupname.Text))
		{
			$GRPtxtGroupname.Focus()
			Paint-FocusBorder $GRPtxtGroupname
			
			$rtbOutput.SelectionFont = $FontBold
			$rtbOutput.SelectionColor = 'Orange'
			$rtbOutput.AppendText("$($LanguageStrings.VBWarning) ")
			$rtbOutput.SelectionFont = $FontRegular
			$rtbOutput.SelectionColor = 'Black'
			$rtbOutput.AppendText("$($LanguageStrings.VBGRPNoGroupName)`r`n")
			$Proceed = $false
		}
		elseif ($GRPtxtGroupname.Text.Length -lt 4)
		{
			$rtbOutput.SelectionFont = $FontBold
			$rtbOutput.SelectionColor = 'Orange'
			$rtbOutput.AppendText("$($LanguageStrings.VBWarning) ")
			$rtbOutput.SelectionFont = $FontRegular
			$rtbOutput.SelectionColor = 'Black'
			$rtbOutput.AppendText("$($LanguageStrings.VBTooFewChar)`r`n")
			$Proceed = $false
		}
		else
		{
			$searchstring = "$($GRPtxtGroupname.Text)*"
			$Proceed = $true
		}
		
		if ($Proceed)
		{
			$statusbar1.Text = $LanguageStrings.STSSearchingGroups
			if ($searchstring.Contains(" "))
			{
				$GroupCount = Get-ADGroupObject -Search $searchstring -FilterType 'DisplayName'
			}
			else
			{
				$GroupCount = Get-ADGroupObject -Search $searchstring -FilterType 'Name'
			}
			
			if ($GroupCount.Name.Count -gt 1)
			{
				### Open SelectObject scherm om de daadwerkelijke groep te selecteren
				if ((Show-SelectObject_psf -LanguageStrings $LanguageStrings -GroupsorUsers $GroupCount.Name -ObjectType 'Group' -FilterType 'Name') -eq 'OK')
				{
					$GRPtxtGroupname.Text = $script:SelectObject_lstSelectObject
					$result = 'OK'
				}
				else
				{
					$result = 'Cancel'
				}
			}
			elseif($GroupCount.Name.Count -eq 1)
			{
				$GRPtxtGroupname.Text = $GroupCount.Name
				$result = 'OK'
			}
			else
			{
				$result = 'NotOK'
			}
			
			if ($result -eq 'OK')
			{
				$statusbar1.Text = $LanguageStrings.STSRefreshingMembership
				if (Update-ADGroupMembership)
				{
					$GRPbtnAdd.Enabled = $true
					$GRPbtnRemove.Enabled = $true
					$GRPbtnAgain.Enabled = $true
					$GRPbtnCopy.Enabled = $true
					$GRPbtnExport.Enabled = $true
					
					Paint-FocusBorder $GRPtxtGroupname
				}
			}
			elseif ($result -eq 'NotOK')
			{
				$rtbOutput.SelectionFont = $FontBold
				$rtbOutput.SelectionColor = 'Orange'
				$rtbOutput.AppendText("$($LanguageStrings.VBWarning) ")
				$rtbOutput.SelectionFont = $FontRegular
				$rtbOutput.SelectionColor = 'Black'
				$rtbOutput.AppendText("$($LanguageStrings.VBGRPNoGroupFound) ")
				$rtbOutput.SelectionFont = $FontBold
				$rtbOutput.AppendText("$($GRPtxtGroupname.Text)`r`n")
				
				$GRPtxtGroupname.Focus()
				
				$GRPbtnAdd.Enabled = $false
				$GRPbtnRemove.Enabled = $false
				$GRPbtnAgain.Enabled = $false
				$GRPbtnCopy.Enabled = $false
				$GRPbtnExport.Enabled = $false
				
				Paint-FocusBorder $GRPtxtGroupname
			}
			elseif ($result -eq 'Cancel')
			{
				$rtbOutput.SelectionFont = $FontBold
				$rtbOutput.AppendText("$($LanguageStrings.VBInfo) ")
				$rtbOutput.SelectionFont = $FontRegular
				$rtbOutput.AppendText("$($LanguageStrings.VBGroupSelectionCancelled)`r`n")
			}
			$statusbar1.Text = $LanguageStrings.STSDone
		}
		else
		{
			$GRPtxtGroupname.Focus()
			
			$GRPbtnAdd.Enabled = $false
			$GRPbtnRemove.Enabled = $false
			$GRPbtnAgain.Enabled = $false
			$GRPbtnCopy.Enabled = $false
			$GRPbtnExport.Enabled = $false
			
			Paint-FocusBorder $GRPtxtGroupname
		}
	}
	
