	#region Form initialization
	$frmAddADUserorGroup_Load={
		#TODO: Initialize Form Controls here
		$rtbAddOutput.Clear()
		$statusbar1.Text = $LanguageStrings.STSReady
		
		$btnAdd.Enabled = $false
		$btnAdd.Text = $LanguageStrings.AFbtnAdd
		$btnCancel.Text = $LanguageStrings.AFbtnCancel
		$btnRetrieve.Text = $LanguageStrings.AFbtnRetrieve
		$lblVerboseOutput.Text = $LanguageStrings.LabelVerboseOutput
		$btnAgain.Enabled = $true
		$btnAgain.Text = $LanguageStrings.ButtonAgain
		
		if ($FormType -eq 'Group')
		{
			$frmAddADUserorGroup.Text = $LanguageStrings.AFFormNameGroups
			$lblADUserorGroup.Text = $LanguageStrings.AFlblADGroup
			$lblGroupsFound.Text = $LanguageStrings.AFGroupsFound
			$lblGroupsToBeAdded.Text = $LanguageStrings.AFGroupsToBeAdded
		}
		elseif ($FormType -eq 'User')
		{
			$frmAddADUserorGroup.Text = $LanguageStrings.AFFormNameUsers
			$lblADUserorGroup.Text = $LanguageStrings.AFlblADUser
			$lblGroupsFound.Text = $LanguageStrings.AFUsersFound
			$lblGroupsToBeAdded.Text = $LanguageStrings.AFUsersToBeAdded
		}
		
		$btnRight.Enabled = $true
		$btnLeft.Enabled = $true
		
		$script:GroupsToBeAdded = @()
	}
	
	$frmAddADUserorGroup_Shown = {
		#TODO: Place custom script here
		$txtADUserorGroup.Focus()
		Paint-FocusBorder $txtADUserorGroup
	}
