	#region Helper Functions
	$ShowHelp = {
		#display popup help
		#each value is the name of a control on the form
		switch ($this.name)
		{
			"txtADUserorGroup" { $tip = $LanguageStrings.TTAddtxtADUserorGroup }
			"lstAddADUsersorGroups" { $tip = $LanguageStrings.TTAddlstAddADUsersorGroups }
			"lstUsersorGroupsToBeAdded" { $tip = $LanguageStrings.TTAddlstUsersorGroupsToBeAdded }
			"btnAdd" { $tip = $LanguageStrings.TTAddbtnAdd }
			"btnCancel" { $tip = $LanguageStrings.TTAddbtnCancel }
			"btnAgain" { $tip = $LanguageStrings.TTAddbtnAgain }
			"btnRetrieve" { $tip = $LanguageStrings.TTAddbtnRetrieve }
			"btnLeft" { $tip = $LanguageStrings.TTAddbtnLeft }
			"btnRight" { $tip = $LanguageStrings.TTAddbtnRight }
			"rtbAddOutput" { $tip = $LanguageStrings.TTAddrtbAddOutput }
		}
		$tt.SetToolTip($this, $tip)
	} #end ShowHelp
