	#region Button Controls
	$btnRetrieve_Click={
		#TODO: Place custom script here
		#$rtbAddOutput.Clear()
		$lstAddADUsersorGroups.SelectedItems.Clear()
		
		if ($FormType -eq 'Group')
		{
			if ([string]::IsNullOrEmpty($txtADUserorGroup.Text))
			{
				$rtbAddOutput.SelectionFont = $FontBold
				$rtbAddOutput.SelectionColor = 'Orange'
				$rtbAddOutput.AppendText("$($LanguageStrings.VBWarning)")
				$rtbAddOutput.SelectionFont = $FontRegular
				$rtbAddOutput.AppendText(" $($LanguageStrings.AFNoADGroup)`r`n")
				
				$txtADUserorGroup.Focus()
				Paint-FocusBorder $txtADUserorGroup
			}
			else
			{
				$statusbar1.Text = $LanguageStrings.STSSearchingGroups
				$searchstring = "$($txtADUserorGroup.Text)*"
				
				$ADgroups = Get-ADGroupObject -Search $searchstring -FilterType 'Name'
				
				if ($ADGroups)
				{
					$rtbAddOutput.SelectionFont = $FontBold
					$rtbAddOutput.AppendText("$($LanguageStrings.VBInfo)")
					$rtbAddOutput.SelectionFont = $FontRegular
					$rtbAddOutput.AppendText(" $($LanguageStrings.AFADGroupFound) ")
					$rtbAddOutput.SelectionFont = $FontBoldItalic
					$rtbAddOutput.AppendText("$($searchstring)`r`n")
					Paint-FocusBorder $txtADUserorGroup
					
					Update-ListBox $lstAddADUsersorGroups $ADgroups "Name"
				}
				else
				{
					$rtbAddOutput.SelectionFont = $FontBold
					$rtbAddOutput.SelectionColor = 'Red'
					$rtbAddOutput.AppendText("$($LanguageStrings.VBError)")
					$rtbAddOutput.SelectionFont = $FontRegular
					$rtbAddOutput.SelectionColor = 'Black'
					$rtbAddOutput.AppendText(" $($LanguageStrings.AFADGroupInvalid) ")
					$rtbAddOutput.SelectionFont = $FontBoldItalic
					$rtbAddOutput.AppendText("$($txtADUserorGroup.Text)`r`n")
					$btnAdd.Enabled = $false
					$txtADUserorGroup.Focus()
					Paint-FocusBorder $txtADUserorGroup
				}
				
				$statusbar1.Text = $LanguageStrings.STSDone
			}
		}
		elseif ($FormType -eq 'User')
		{
			if ([string]::IsNullOrEmpty($txtADUserorGroup.Text))
			{
				$rtbAddOutput.SelectionFont = $FontBold
				$rtbAddOutput.SelectionColor = 'Orange'
				$rtbAddOutput.AppendText("$($LanguageStrings.VBWarning)")
				$rtbAddOutput.SelectionFont = $FontRegular
				$rtbAddOutput.AppendText(" $($LanguageStrings.AFNoADUser)`r`n")
				
				$txtADUserorGroup.Focus()
				Paint-FocusBorder $txtADUserorGroup
			}
			else
			{
				$statusbar1.Text = $LanguageStrings.STSearchingUsers
				$searchstring = "$($txtADUserorGroup.Text)*"
				
				$ADusers = Get-ADUserObject -Search $searchstring -FilterType 'SamAccountName'
				
				if ($ADusers)
				{
					$rtbAddOutput.SelectionFont = $FontBold
					$rtbAddOutput.AppendText("$($LanguageStrings.VBInfo)")
					$rtbAddOutput.SelectionFont = $FontRegular
					$rtbAddOutput.AppendText(" $($LanguageStrings.AFUserFound) ")
					$rtbAddOutput.SelectionFont = $FontBoldItalic
					$rtbAddOutput.AppendText("$($searchstring)`r`n")
					Paint-FocusBorder $txtADUserorGroup
					
					Update-ListBox $lstAddADUsersorGroups $ADusers "SamAccountName"
				}
				else
				{
					$rtbAddOutput.SelectionFont = $FontBold
					$rtbAddOutput.SelectionColor = 'Red'
					$rtbAddOutput.AppendText("$($LanguageStrings.VBError)")
					$rtbAddOutput.SelectionFont = $FontRegular
					$rtbAddOutput.SelectionColor = 'Black'
					$rtbAddOutput.AppendText(" $($LanguageStrings.AFADUserInvalid) ")
					$rtbAddOutput.SelectionFont = $FontBoldItalic
					$rtbAddOutput.AppendText("$($txtADUserorGroup.Text)`r`n")
					$btnAdd.Enabled = $false
					$txtADUserorGroup.Focus()
					Paint-FocusBorder $txtADUserorGroup
				}
				$statusbar1.Text = $LanguageStrings.STSDone
			}
		}
		
	}
	
	$btnAgain_Click = {
		#TODO: Place custom script here
		$btnAdd.Enabled = $false
		$txtADUserorGroup.Clear()
		$lstAddADUsersorGroups.Items.Clear()
		$lstUsersorGroupsToBeAdded.Items.Clear()
		$txtADUserorGroup.Focus
		Paint-FocusBorder $txtADUserorGroup
	}
	
	$btnRight_Click = {
		#TODO: Place custom script here
		if ($lstAddADUsersorGroups.SelectedItems -ne 0)
		{
			foreach ($i in $lstAddADUsersorGroups.SelectedItems)
			{
				if ($FormType -eq 'Group')
				{
					if (!($script:UsersorGroupsToBeAdded -contains $i.Name))
					{
						Update-ListBox $lstUsersorGroupsToBeAdded $i.Name -Append
						$script:UsersorGroupsToBeAdded += $i.Name
						$btnAdd.Enabled = $true
					}
					else
					{
						$rtbAddOutput.SelectionFont = $FontBold
						$rtbAddOutput.SelectionColor = 'Orange'
						$rtbAddOutput.AppendText("$($LanguageStrings.VBWarning)")
						$rtbAddOutput.SelectionFont = $FontRegular
						$rtbAddOutput.AppendText(" $($LanguageStrings.VBGroupAlreadyAdded)`r`n")
					}
				}
				elseif ($FormType -eq 'User')
				{
					if (!($script:UsersorGroupsToBeAdded -contains $i.SamAccountName))
					{
						Update-ListBox $lstUsersorGroupsToBeAdded $i.SamAccountName -Append
						$script:UsersorGroupsToBeAdded += $i.SamAccountName
						$btnAdd.Enabled = $true
					}
					else
					{
						$rtbAddOutput.SelectionFont = $FontBold
						$rtbAddOutput.SelectionColor = 'Orange'
						$rtbAddOutput.AppendText("$($LanguageStrings.VBWarning)")
						$rtbAddOutput.SelectionFont = $FontRegular
						$rtbAddOutput.AppendText(" $($LanguageStrings.VBUserAlreadyAdded)`r`n")
					}
				}
			}
		}
		else
		{
			$rtbAddOutput.SelectionFont = $FontBold
			$rtbAddOutput.SelectionColor = 'Orange'
			$rtbAddOutput.AppendText("$($LanguageStrings.VBWarning)")
			$rtbAddOutput.SelectionFont = $FontRegular
			if ($FormType -eq 'Group') { $rtbAddOutput.AppendText(" $($LanguageStrings.VBNoGroup)`r`n") } elseif ($FormType -eq 'User') { $rtbAddOutput.AppendText(" $($LanguageStrings.VBNoUser)`r`n") }
			$btnAdd.Enabled = $false
		}
	}
	
	$btnLeft_Click = {
		#TODO: Place custom script here
		if ($lstUsersorGroupsToBeAdded.SelectedItems -ne 0)
		{
			foreach ($i in $lstUsersorGroupsToBeAdded.SelectedItems)
			{
				$script:UsersorGroupsToBeAdded = $UsersorGroupsToBeAdded | Where-Object { $_ -ne $i }
			}
			
			for ($i = $lstUsersorGroupsToBeAdded.SelectedItems.Count - 1; $i -ge 0; $i--)
			{
				$lstUsersorGroupsToBeAdded.Items.Remove($lstUsersorGroupsToBeAdded.SelectedItems[$i])
			}
		}
		else
		{
			$rtbAddOutput.SelectionFont = $FontBold
			$rtbAddOutput.SelectionColor = 'Orange'
			$rtbAddOutput.AppendText("$($LanguageStrings.VBWarning)")
			$rtbAddOutput.SelectionFont = $FontRegular
			if ($Group) { $rtbAddOutput.AppendText(" $($LanguageStrings.VBNoGroup)`r`n") } elseif ($User) { $rtbAddOutput.AppendText(" $($LanguageStrings.VBNoUser)`r`n") }
			$btnAdd.Enabled = $false
		}
	}
	
	$txtADUserorGroup_KeyDown=[System.Windows.Forms.KeyEventHandler]{
	#Event Argument: $_ = [System.Windows.Forms.KeyEventArgs]
		#TODO: Place custom script here
		if ($_.KeyCode -eq "Enter")
		{
			$btnRetrieve_Click.Invoke()
			$btnRetrieve.Focus()
			Paint-FocusBorder $txtADUserorGroup
		}
	}
	#endregion
	
	#region Mouse Click Controls
	$lstAddADUsersorGroups_MouseDoubleClick = [System.Windows.Forms.MouseEventHandler]{
	#Event Argument: $_ = [System.Windows.Forms.MouseEventArgs]
		#TODO: Place custom script here
		$btnAdd.Enabled = $true
		if ($FormType -eq 'Group')
		{
			Update-ListBox $lstUsersorGroupsToBeAdded ($lstAddADUsersorGroups.SelectedItem).Name -Append
			$script:UsersorGroupsToBeAdded += ($lstAddADUsersorGroups.SelectedItem).Name
		}
		elseif ($FormType -eq 'User')
		{
			Update-ListBox $lstUsersorGroupsToBeAdded ($lstAddADUsersorGroups.SelectedItem).SamAccountName -Append
			$script:UsersorGroupsToBeAdded += ($lstAddADUsersorGroups.SelectedItem).SamAccountName
		}
		
	}
	
	$lstUsersorGroupsToBeAdded_MouseDoubleClick=[System.Windows.Forms.MouseEventHandler]{
	#Event Argument: $_ = [System.Windows.Forms.MouseEventArgs]
		#TODO: Place custom script here
		
		$script:UsersorGroupsToBeAdded = $UsersorGroupsToBeAdded | Where-Object { $_ -ne $lstUsersorGroupsToBeAdded.SelectedItem }
		$lstUsersorGroupsToBeAdded.Items.Remove($lstUsersorGroupsToBeAdded.SelectedItem)
	}
